import React from 'react';
import Row from 'react-bootstrap/Row';
import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import AddIcon from '@mui/icons-material/Add';
import NavSearch from '../navSection/NavSearch';

function Cart() {
  return (
    <div>
        <NavSearch/>
      <Row className='my-3'>
        <Card>
          <Card.Body>
            <h5 className="text-center">You have (3) items in your cart</h5>
            <div className="d-flex flex-column gap-1">
              <strong className=''>Total: 37600.00</strong>
              <div>
                {' '}
                <Button variant="light" className="text-success">
                  <AddIcon />
                  Add payment method
                </Button>{' '}
              </div>
              <div>
                <Button variant="light" className="text-success">
                  <AddIcon />
                  Add shipping
                </Button>{' '}
              </div>
            </div>
            <Row>
              <Col></Col>
            </Row>
          </Card.Body>
        </Card>
      </Row>
    </div>
  );
}

export default Cart;
